import React,{Component} from "react";

 class RecordList extends Component {
    render() {
        return (
            <tr>
                <td>{this.props.obj.sku}</td>
                
                <td>{this.props.obj.name}</td>

                <td>{this.props.obj.price}</td>

              {/*  <td>{this.props.obj.attribute}</td> */}

            </tr>
        );
    }
}

export default RecordList;
